pub fn build_grid(s: Option<Vec<i64>>) -> Result<Vec<Vec<char>>, &'static str> {
    let v = s.ok_or("s is None")?;
    if v.len() != 15 { return Err("s.len != 15"); }

    let mut grid: Vec<Vec<char>> = Vec::with_capacity(5);

    for col in 0..5 {
        let mut column: Vec<char> = Vec::with_capacity(3);
        for row in 0..3 {
            let n = v[row * 5 + col]; // layout -> [[10,11,8],[3,9,7],[6,11,12],[3,5,4],[6,5,3]]
            let u = u8::try_from(n).map_err(|_| "symbol out of range")?;
            if !(1..=26).contains(&u) { return Err("symbol out of range"); }
            column.push((u + 64) as char); // 1->A, 2->B, ...
        }
        grid.push(column);
    }

    Ok(grid)
}

pub fn build_mults(mo: Option<Vec<i64>>) -> Result<Vec<Vec<i32>>, &'static str> {
    let v = mo.ok_or("mo is None")?;
    if v.len() != 15 { return Err("mo.len != 15"); }

    let mut mults: Vec<Vec<i32>> = Vec::with_capacity(5);

    for col in 0..5 {
        let mut column: Vec<i32> = Vec::with_capacity(3);
        for row in 0..3 {
            let n = v[row * 5 + col];
            let m = i32::try_from(n).map_err(|_| "mult out of range")?;
            column.push(m);
        }
        mults.push(column);
    }

    Ok(mults)
}

fn convert(name: &str) {
    let list = parse_packet(name);
    let mut iter = list.into_iter().peekable();
    let mut results: Vec<FuGaSoTuple<BigBassBonanza1000Info, ReSpinInfo>> = Vec::new();
	let mut fs_active = false;
	let mut request: fugaso_math::math::Request = Default::default();
    while let Some(tuple) = iter.next() {
		let converted_tr_opt: Option<Vec<FuGaSoTuple<BigBassBonanza1000Info, ReSpinInfo>>> = match serde_json::from_value::<Option<SourceBigBassBonanza1000>>(tuple.response).inspect_err(|e| {eprintln!("err {e}");}).unwrap_or(None) {
			Some(source_big_bass_bonanza_1000) => {
				if let Ok(Some(player)) = serde_json::from_value::<Option<Player>>(tuple.request) {
					if player.action == ClientActionEnum::Dospin {
						let total = (source_big_bass_bonanza_1000.tw.unwrap_or_default() * 100.0) as i64;
						let accum = (source_big_bass_bonanza_1000.fswin.unwrap_or_default() * 100.0) as i64;
						let balance = (source_big_bass_bonanza_1000.balance * 100.0) as i64;
						let respins = (source_big_bass_bonanza_1000.fsmax.unwrap_or(0) - source_big_bass_bonanza_1000.fs.map(|fs| {fs - 1}).unwrap_or(0)) as i32;
						let grid0 = build_grid(source_big_bass_bonanza_1000.is).unwrap_or_default();
						let grid = build_grid(source_big_bass_bonanza_1000.s).unwrap_or_default();
						let gains = source_big_bass_bonanza_1000.lines.unwrap_or_default().into_iter().map(|l| {
							let mut g = Gain::default();
							g.amount = (l.amount * 100.0) as i64;
							g.line_num = l.line_num as usize;
							g.points = l.points.into_iter().map(|p| BasePoint { x: p.x as usize, y: p.y as usize }).collect();
							g
        				}).collect();
						let mults = build_mults(source_big_bass_bonanza_1000.mo).unwrap_or_default();
						let overlay = None;

						let mut round_tansactions = Vec::new();
						if fs_active {
							
							// free spin input start
							let next_act = match source_big_bass_bonanza_1000.na {
								ServerNaEnum::C => ActionKind::COLLECT,
								_ => {
									if source_big_bass_bonanza_1000.fs.is_none() {
										fs_active = false;
										ActionKind::BET
									} else {ActionKind::RESPIN}
								},
							};

							let link = BigBassBonanza1000Info {total, accum, respins, overlay, mults, ..Default::default() };
							let response: SpinData<BigBassBonanza1000Info, ReSpinInfo> = SpinData {
								id: id::GAME_DATA,
								balance,
								credit_type: 100,
								result: GameResult {
									total,
									grid,
									grid0,
									gains,
									special: Some(link),
									..Default::default()
								},
								curr_lines: 5,
								curr_bet: request.bet,
								curr_denom: request.denom,
								curr_reels: 5,
								next_act,
								round_id: 0,
								round_type: RoundDetail::SIMPLE,
								round_multiplier: 1,
								promo: Promo {
									amount: 0,
									multi: 0,
								},
								..Default::default()
							};
							let output = fugaso_core::protocol::Response::GameData(Arc::new(GameData::ReSpin(response.clone())));
							// free spin output end
							
							round_tansactions.push(FuGaSoTuple {input: PlayerRequest::ReSpin, output: vec![output] });
							Some(round_tansactions)
						} else {
								// spin input start
								let denom: i32 = 10;
								let bet_counters = [100, 150, 1000, 4500];
								let total_bet = if let Some(bet) = &player.c {(bet * 100.0) as i32  / denom} else {0};
								let selected_mode = if let Some(pur) = &player.pur {if *pur == 1 {3} else {2}} else {if player.bl.is_some() {1} else {0}};
								let bet_counter = bet_counters[selected_mode];
								request = fugaso_math::math::Request {
									bet: total_bet,
									bet_counter,
									denom,
									..Default::default()
								};
								let input = PlayerRequest::BetSpin(request.clone());
								// spin input end

								// spin output start
								let next_act = match source_big_bass_bonanza_1000.na {
									ServerNaEnum::C => ActionKind::COLLECT,
									_ => {
										if source_big_bass_bonanza_1000.fs.is_some() {
											fs_active = true;
											ActionKind::RESPIN
										} else {ActionKind::BET}
									},
								};

								let link = BigBassBonanza1000Info {total, respins, overlay, mults,..Default::default() };
								let response: SpinData<BigBassBonanza1000Info, ReSpinInfo> = SpinData {
									id: id::GAME_DATA,
									balance,
									credit_type: 100,
									result: GameResult {
										total,
										grid,
										grid0,
										gains,
										special: Some(link),
										..Default::default()
									},
									curr_lines: 5,
									curr_bet: request.bet,
									curr_denom: request.denom,
									curr_reels: 5,
									next_act,
									round_id: 0,
									round_type: RoundDetail::SIMPLE,
									round_multiplier: 1,
									promo: Promo {
										amount: 0,
										multi: 0,
									},
									..Default::default()
								};
								let output = fugaso_core::protocol::Response::GameData(Arc::new(GameData::Spin(response)));
								// spin output end

								round_tansactions.push(FuGaSoTuple {input, output: vec![output]});
								Some(round_tansactions)
						}
					} else {None}
				} else {None}
			}
			_ => None,
		};

		//add to result tansactions
		if let Some(converted_tr) = converted_tr_opt {results.extend(converted_tr)};
    }
	//save
    std::fs::create_dir_all(format!("packets_result/{GAME_FUGASO_FOLDER}")).unwrap();
    serde_json::to_writer(File::create(format!("packets_result/{GAME_FUGASO_FOLDER}/{name}")).expect("error file open"), &results,).expect("error write file");
}

